    public static ArrayList<Long> filterIntegers(ArrayList<Object> values) {
        return values.stream().filter(value -> {
            try {
                if (value instanceof Integer) return true;
                else if (value instanceof Double && Math.ceil((Double)value) == (Double)value) return true;
                else if (value instanceof Long) return true;
                else if (value instanceof Float && Math.ceil((Float)value) == (Float)value) return true;
                else return false;
            }
            catch (Exception e) {
                return false;
            }
        }).map(value -> {
            if (value instanceof Integer) return (long)(Integer)value;
            else if (value instanceof Float) return (long)(Float)value;
            else if (value instanceof Double) return (long)(Double)value;
            else return (long)(Long)value;
        }).collect(Collectors.toCollection(ArrayList::new));

