            return new ArrayList<Long>(Arrays.asList(number, 0l));
        else if (remaining < need - number)
            return new ArrayList<Long>(Arrays.asList(number + remaining, 0l));
        return new ArrayList<Long>(Arrays.asList(number + need, remaining - need));

